// src/components/Resume.jsx
import "../styles/main.css";

const Resume = () => (
    <section id="resume" className="section alt-bg">
      <h2>Resume</h2>
      <p className="center-text">
        <a href="https://drive.google.com/file/d/1mUYsm65rovjsUHYXJEdcZnpcU0dTcOPH/view?usp=sharing" className="cta-button" target="_blank" rel="noreferrer">
          Download My Resume
        </a>
      </p>
    </section>
  );

  export default Resume;
